import{_ as e,o as t,c as r,O as a}from"./chunks/framework.9482e208.js";const g=JSON.parse('{"title":"§ 2.2-414 Record of registration; certification of registration; fees.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/2.2-414.md","filePath":"vacode/2.2-414.md"}'),o={name:"vacode/2.2-414.md"},i=a('<h1 id="§-2-2-414-record-of-registration-certification-of-registration-fees" tabindex="-1">§ 2.2-414 Record of registration; certification of registration; fees. <a class="header-anchor" href="#§-2-2-414-record-of-registration-certification-of-registration-fees" aria-label="Permalink to &quot;§ 2.2-414 Record of registration; certification of registration; fees.&quot;">​</a></h1><p>A. The Secretary of the Commonwealth shall keep a properly indexed record of the registration provided for by § <a href="http://law.lis.virginia.gov/vacode/2.2-411/" target="_blank" rel="noreferrer">2.2-411</a>, which record shall also show any altered or canceled registration.</p><p>B. Upon granting registration provided in § <a href="http://law.lis.virginia.gov/vacode/2.2-411/" target="_blank" rel="noreferrer">2.2-411</a>, the Secretary of the Commonwealth shall issue his certificate to the petitioners, setting forth the fact of such registration.</p><p>C. The fees of the Secretary of the Commonwealth for registration, alteration, cancellation, searches, and certificates issued pursuant to this article shall be the same as provided by law for similar services.</p><p>Code 1950, § 38-311; 1952, c. 225, § 2-64.4; 1966, c. 677, §§ 2.1-77, 2.1-79, 2.1-81; 2001, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?011+ful+CHAP0844" target="_blank" rel="noreferrer">844</a>.</p>',5),s=[i];function n(c,f,l,h,d,p){return t(),r("div",null,s)}const m=e(o,[["render",n]]);export{g as __pageData,m as default};
